import React from 'react';
import { Route, Redirect } from 'react-router';
let auth;
auth= null;
auth=true;
const Privateroute = ({component, ...rest}) => {
    return (
        <Route {...rest}>{auth ? <component /> : <Redirect to='/login' /> } </Route>
    )
}

export default Privateroute;
